import React from 'react'
import './Main.css'
import logo from '../../assets/logo.png';

const Main = () => {
    return (
        <div className="container-main">
            <div>
            <img src= {logo}
            width='20%'
            alt='logo'
            />
            </div>
            <div>
            <h1>Chatbot</h1>
            </div>
        </div>
    )
}

export default Main
